function makeid(l)
{
var text = "";
var char_list = "abcdefghijklmnopqrstuvwxyz";
for(var i=0; i < l; i++ )
{  
text += char_list.charAt(Math.floor(Math.random() * char_list.length));
}
return text;
}

var number = Math.floor(Math.random() * 1000);

document.write('{"letter": "'+makeid(1)+'","offset": "'+number+'"}');

